import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Step 1: Add an item to the cart to set up the test state
    // We use evaluate to call the existing JavaScript function on the page
    await page.evaluate(() => {
      // @ts-ignore
      addToCart(1); // Add product with ID 1 (iPhone)
    });

    // Step 2: Open the cart modal
    await page.waitForSelector('div.cart', { timeout: 5000 });
    await page.locator('div.cart').click();

    // Wait for the cart modal to be visible and take a screenshot
    await page.waitForSelector('#cartModal', { state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_item_in_cart.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_item_in_cart.png'));

    // Step 3: Find and click the "Remove" button for the item in the cart
    const removeButton = page.locator('.cart-item .remove-item');
    await removeButton.waitFor({ state: 'visible', timeout: 5000 });
    await removeButton.click();

    // Step 4: Verify the item is removed by checking for the "empty cart" message
    const emptyCartLocator = page.locator('.empty-cart');
    await emptyCartLocator.waitFor({ state: 'visible', timeout: 5000 });

    // Take a final screenshot showing the empty cart
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_empty.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_empty.png'));

    // Extract data to confirm the cart is empty
    const emptyCartMessage = await emptyCartLocator.textContent();
    const cartTotal = await page.locator('#cartTotal').textContent();

    return {
      success: true,
      action: "Successfully removed an item from the cart.",
      extractedData: {
        emptyCartMessage: emptyCartMessage?.trim(),
        cartTotal: cartTotal?.trim()
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // In case of an error, capture the final state
    await page.screenshot({ path: path.join(screenshotsDir, 'error.png') });
    screenshots.push(path.join(screenshotsDir, 'error.png'));

    return {
      success: false,
      action: "Failed to remove item from cart",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
